import React from "react";
import "../App.css";
import resume from "./KhyleCVJan23_23.pdf";


function Resume() {
    return (
        <div id="resume" className="RES">
            <iframe src={resume} title="resume" width="60%" height="1000px"></iframe> 
        </div>
    );
}

export default Resume;
